import { useSelector } from 'react-redux'

const Profile = () => {
    const user = useSelector(state => state.user)

    return(
        <>
            <div className="row text-center">
                <h3 className="my-5">Welcome to your Profile {user.firstName} {user.lastName}</h3>
                <div className="col-4">

                </div>
            </div>
        </>
    )
}

export default Profile
